  return(
    <div className="navbar bg-dark fixed-top mb-3">
      <span className="navbar-brand">NotePad</span>
      <div className="form-inline">
        <input 
          type="text"
          placeholder="Search..."
          onChange={(e)=>handleFilter(e.target.value)}
          className="form-control"/>
      </div>

    </div>
  );
}

